import React, { Component } from 'react';
class counter extends Component {

    render() { 
        return ( 
            <React.Fragment>
                <span>{this.props.value}</span>
                <button onClick={this.props.onIncrement}>Increment</button>
                <button></button>
            </React.Fragment>
         );
    }
}

export default counter;
